import React, { useState } from 'react';
import './ImageDisplay.css';

const ImageDisplay = () => {
  const [selectedImage, setSelectedImage] = useState(1);

  const handleImageChange = (imageNumber) => {
    setSelectedImage(imageNumber);
  };

  return (
    <div className="image-container">
      <div className="image-wrapper">
        {selectedImage === 1 && (
          <img
            src="https://cdn.midjourney.com/5db07a7d-8253-45c6-a11e-6300683a8d12/0_2.png"
            alt="example 1"
            className="image"
          />
        )}
        {selectedImage === 2 && (
          <img
            src="https://cdn.midjourney.com/23694dd7-f7ba-41e5-b11e-cd25ef32072f/0_1.png"
            alt="example 2"
            className="image"
          />
        )}
        {selectedImage === 3 && (
          <img
            src="https://cdn.midjourney.com/28467631-be3f-4e0d-9d2a-86ab0a788155/0_2.png"
            alt="example 3"
            className="image"
          />
        )}
      </div>
      <div className="buttons">
        <button
          className={`image-button ${selectedImage === 1 ? 'selected' : ''}`}
          onClick={() => handleImageChange(1)}
        >
          1
        </button>
        <button
          className={`image-button ${selectedImage === 2 ? 'selected' : ''}`}
          onClick={() => handleImageChange(2)}
        >
          2
        </button>
        <button
          className={`image-button ${selectedImage === 3 ? 'selected' : ''}`}
          onClick={() => handleImageChange(3)}
        >
          3
        </button>
      </div>
    </div>
  );
};

export default ImageDisplay;
